import './style.css'
import React from "react";
import { Col, Card, Row } from "react-bootstrap"

const ItemEmpresa = (props) => {
    const { cargo, testimonio, nome, avatar } = props

    return (
        <Col className="Cards-Empresa">
            <Card testimonial className="Testimonial">
                <Row className='Testimonial__top'>
                    <p className="Testimonial__top__testimonio">
                        {testimonio}
                    </p>
                </Row>
            </Card>
        </Col>
    );
}
export default ItemEmpresa
